//developers.weixin.qq.com/miniprogram/dev/component/ad.html" }] }, { name: "binderror", description: "*(eventhandle)*\n广告加载失败的回调，event.detail = {errCode: 1002}", attrType: "eventhandle", references: [{ name: "微信开放文档", url: "https://developers.weixin.qq.com/miniprogram/dev/component/ad.html" }] }, { name: "bindclose", description: "*(eventhandle)*\n广告关闭的回调", attrType: "eventhandle", references: [{ name: "微信开放文档", url: "https://developers.weixin.qq.com/miniprogram/dev/component/ad.html" }] }], references: [{ name: "微信开放文档", url: "https://developers.weixin.qq.com/miniprogram/dev/component/ad.html" }] }, { name: "aria-component", description: "\n## 无障碍访问\n\n为了更好地满足视障人士对于小程序的访问需求，基础库自2.7.1起，支持部分ARIA标签。\n\n无障碍特性在读屏模式下可以访问，iOS可通过设置->通用->辅助功能->旁白打开。\n\n以 [view]((view)) 组件为例，开发者可以增加`aria-role`和`aria-label`属性。\n其中`aria-role`表示组件的角色，当设置为'img'时，读屏模式下聚焦后系统会朗读出'图像'。设置为'button'时，聚焦后后系统朗读出'按钮'。\n`aria-label`表示组件附带的额外信息，聚焦后系统会自动朗读出来。\n\n小程序已经内置了一些无障碍的特性，对于非原生组件，开发者可以添加以下无障碍标签。\n\n|                      |                 |               |                 |                 |\n| -------------------- | --------------- | ------------- | --------------- | --------------- |\n| aria-hidden          | aria-role       | aria-label    | aria-checked    | aria-disabled   |\n| aria-describedby     | aria-expanded   | aria-haspopup | aria-selected   | aria-required   |\n| aria-orientation     | aria-valuemin   | aria-valuemax | aria-valuenow   | aria-readonly   |\n| aria-multiselectable | aria-controls   | tabindex      | aria-labelledby | ria-orientation |\n| aia-multiselectable  | aria-labelledby |               |                 |\n\n## 示例代码\n\n```html\n<view aria-role=\"button\"  aria-label=\"提交表单\">提交</view>\n```\n\n#### Tips\n1. 安卓和iOS读屏模式下设置`aria-role`后朗读的内容不同系统之间会有差异\n2. 可设置的`aria-role`可参看 [Using Aria](https://developer.mozilla.org/en-US/docs/Web/Accessibility/ARIA/ARIA_Techniques)中的`Widget Roles`，部分role的设置在移动端可能无效。\n\n\n", attributes: [], references: [{ name: "微信开放文档", url: "https://developers.weixin.qq.com/miniprogram/dev/component/aria-component.html" }] }, { name: "audio", description: "\n(基础库 1.0.0+)\n\n音频。{% version('1.6.0') %}版本开始，该组件不再维护。建议使用能力更强的 [wx.createInnerAudioContext]((wx.createInnerAudioContext)) 接口\n\n", attributes: [{ name: "id", description: "*(string)*\naudio 组件的唯一标识符", attrType: "string", references: [{ name: "微信开放文档", url: "https://developers.weixin.qq.com/miniprogram/dev/component/audio.html" }] }, { name: "src", description: "*(string)*\n要播放音频的资源地址", attrType: "string", references: [{ name: "微信开放文档", url: "https://developers.weixin.qq.com/miniprogram/dev/component/audio.html" }] }, { name: "loop", description: "*(boolean)*\n是否循环播放", attrType: "boolean", references: [{ name: "微信开放文档", url: "https://developers.weixin.qq.com/miniprogram/dev/component/audio.html" }] }, { name: "controls", description: "*(boolean)*\n是否显示默认控件", attrType: "boolean", references: [{ name: "微信开放文档", url: "https://developers.weixin.qq.com/miniprogram/dev/component/audio.html" }] }, { name: "poster", description: "*(string)*\n默认控件上的音频封面的图片资源地址，如果 controls 属性值为 false 则设置 poster 无效", attrType: "string", references: [{ name: "微信开放文档", url: "https://developers.weixin.qq.com/miniprogram/dev/component/audio.html" }] }, { name: "name", description: "*(string)*\n默认控件上的音频名字，如果 controls 属性值为 false 则设置 name 无效", attrType: "string", references: [{ name: "微信开放文档", url: "https://developers.weixin.qq.com/miniprogram/dev/component/audio.html" }] }, { name: "author", description: "*(string)*\n默认控件上的作者名字，如果 controls 属性值为 false 则设置 author 无效", attrType: "string", references: [{ name: "微信开放文档", url: "https://developers.weixin.qq.com/miniprogram/dev/component/audio.html" }] }, { name: "binderror", description: "*(eventhandle)*\n当发生错误时触发 error 事件，detail = {errMsg:MediaError.code}", attrType: "eventhandle", references: [{ name: "微信开放文档", url: "https://developers.weixin.qq.com/miniprogram/dev/component/audio.html" }] }, { name: "bindplay", description: "*(eventhandle)*\n当开始/继续播放时触发play事件", attrType: "eventhandle", references: [{ name: "微信开放文档", url: "https://developers.weixin.qq.com/miniprogram/dev/component/audio.html" }] }, { name: "bindpause", description: "*(eventhandle)*\n当暂停播放时触发 pause 事件", attrType: "eventhandle", references: [{ name: "微信开放文档", url: "https://developers.weixin.qq.com/miniprogram/dev/component/audio.html" }] }, { name: "bindtimeupdate", description: "*(eventhandle)*\n当播放进度改变时触发 timeupdate 事件，detail = {currentTime, duration}", attrType: "eventhandle", references: [{ name: "微信开放文档", url: "https://developers.weixin.qq.com/miniprogram/dev/component/audio.html" }] }, { name: "bindended", description: "*(eventhandle)*\n当播放到末尾时触发 ended 事件", attrType: "eventhandle", references: [{ name: "微信开放文档", url: "https://developers.weixin.qq.com/miniprogram/dev/component/audio.html" }] }], references: [{ name: "微信开放文档", url: "https://developers.weixin.qq.com/miniprogram/dev/component/audio.html" }] }, { name: "button", description: "\n(基础库 1.0.0+)\n\n按钮。\n\n", attributes: [{ name: "size", description: "*(string)*\n按钮的大小", attrType: "string", references: [{ name: "微信开放文档", url: "https://developers.weixin.qq.com/miniprogram/dev/component/button.html" }], values: [{ name: "default", description: "默认大小", references: [{ name: "微信开放文档", url: "https://developers.weixin.qq.com/miniprogram/dev/component/button.html" }] }, { name: "mini", description: "小尺寸", references: [{ name: "微信开放文档", url: "https://developers.weixin.qq.com/miniprogram/dev/component/button.html" }] }] }, { name: "type", description: "*(string)*\n按钮的样式类型", attrType: "string", references: [{ name: "微信开放文档", url: "https://developers.weixin.qq.com/miniprogram/dev/component/button.html" }], values: [{ name: "primary", description: "绿色", references: [{ name: "微信开放文档", url: "https://developers.weixin.qq.com/miniprogram/dev/component/button.html" }] }, { name: "default", description: "白色", references: [{ name: "微信开放文档", url: "https://developers.weixin.qq.com/miniprogram/dev/component/button.html" }] }, { name: "warn", description: "红色", references: [{ name: "微信开放文档", url: "https://developers.weixin.qq.com/miniprogram/dev/component/button.html" }] }] }, { name: "plain", description: "*(boolean)*\n按钮是否镂空，背景色透明", attrType: "boolean", references: [{ name: "微信开放文档", url: "https://developers.weixin.qq.com/miniprogram/dev/component/button.html" }] }, { name: "disabled", description: "*(boolean)*\n是否禁用", attrType: "boolean", references: [{ name: "微信开放文档", url: "https://developers.weixin.qq.com/miniprogram/dev/component/button.html" }] }, { name: "loading", description: "*(boolean)*\n名称前是否带 loading 图标", attrType: "boolean", references: [{ name: "微信开放文档", url: "https://developers.weixin.qq.com/miniprogram/dev/component/button.html" }] }, { name: "form-type", description: "*(string)*\n用于 [form]((form)) 组件，点击分别会触发 [form]((form)) 组件的 submit/reset 事件", attrType: "string", references: [{ name: "微信开放文档", url: "https://developers.weixin.qq.com/miniprogram/dev/component/button.html" }], values: [{ name: "submit", description: "提交表单", references: [{ name: "微信开放文档", url: "https://developers.weixin.qq.com/miniprogram/dev/component/button.html" }] }, { name: "reset", description: "重置表单", references: [{ name: "微信开放文档", url: "https://developers.weixin.qq.com/miniprogram/dev/component/button.html" }] }] }, { name: "open-type", description: "*(string)*\n微信开放能力", attrType: "string", references: [{ name: "微信开放文档", url: "https://developers.weixin.qq.com/miniprogram/dev/component/button.html" }], values: [{ name: "contact", description: "打开客服会话，如果用户在会话中点击消息卡片后返回小程序，可以从 bindcontact 回调中获得具体信息，[具体说明]((customer-message)) （*小程序插件中不能使用*）", references: [{ name: "微信开放文档", url: "https://developers.weixin.qq.com/miniprogram/dev/component/button.html" }] }, { name: "share", description: "触发用户转发，使用前建议先阅读[使用指引]((share#使用指引))", references: [{ name: "微信开放文档", url: "https://developers.weixin.qq.com/miniprogram/dev/component/button.html" }] }, { name: "getPhoneNumber", description: "获取用户手